 function getBlockNumbers() {
        global $dbc;
        $userid="4548";
        $q = "SELECT `numbers` FROM `az_blocknumbers` where ((userid='$userid')||(userid='-1')) and status=0";
        $rs = mysqli_query($dbc, $q);
        $numbers = array();
        if (mysqli_num_rows($rs)) {
            while ($row = mysqli_fetch_assoc($rs)) {
                $numbers[] = $row['numbers'];
            }
        }
        return $numbers;
    }



